const Card = (props) => {
  return (
    <div className="card">
      <img class="img" src={props.imgsrc} />
      <div class="content">
        <p class="name">{props.name}</p>
        <p class="role">{props.role}</p>
        <p class="text">{props.text}</p>
        <div class="icon">
          <span class="fab fa-instagram"></span>
          <span class="fab fa-facebook"></span>
          <span class="fab fa-twitter"></span>
        </div>
      </div>
    </div>
  );
};

export default Card;
